import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './StyleTest.module.css';

const categories = [
  'Basic jumpers',
  'Warm puffer',
  'Bomber',
  'Biker jacket'
];

const toolbarItems = [
  { id: 'collar', icon: '/assets1/icons/collar.png', label: 'Collar' },
  { id: 'styles', icon: '/assets1/icons/styles.png', label: 'Styles' },
  { id: 'pant', icon: '/assets1/icons/pant.png', label: 'Pant' },
  { id: 'coat', icon: '/assets1/icons/coat.png', label: 'Coat' },
  { id: 'accessories', icon: '/assets1/icons/accessories.png', label: 'Accessories' },
  { id: 'tools', icon: '/assets1/icons/tools.png', label: 'Tools' }
];

// Local profile images
const profileImages = [
  '/assets1/1.png',
  '/assets1/2.png',
  '/assets1/3.png',
  '/assets1/4.png',
  '/assets1/5.png',
  '/assets1/6.png',
  '/assets1/7.png'
];

export default function StyleTest() {
  const navigate = useNavigate();
  const [selectedProfile, setSelectedProfile] = useState(0);
  const [selectedCategory, setSelectedCategory] = useState(0);
  const [isFavorite, setIsFavorite] = useState(false);
  const [isProcessing, setIsProcessing] = useState(false);
  const [processingProgress, setProcessingProgress] = useState(0);
  const [mainImage, setMainImage] = useState('/assets1/man.png');
  const fileInputRef = React.useRef(null);

  const handleClose = () => {
    navigate(-1);
  };

  const toggleFavorite = () => {
    setIsFavorite(!isFavorite);
  };

  const handleProfileClick = (index) => {
    setSelectedProfile(index);
    setMainImage(profileImages[index]);
    startAIProcessing(() => {
      navigate('/style-editor', { 
        state: { 
          selectedProfile: index,
          selectedCategory: selectedCategory,
          isFavorite: isFavorite
        }
      });
    });
  };

  const startAIProcessing = (onComplete) => {
    setIsProcessing(true);
    setProcessingProgress(0);

    const interval = setInterval(() => {
      setProcessingProgress(prev => {
        if (prev >= 100) {
          clearInterval(interval);
          setIsProcessing(false);
          onComplete();
          return 100;
        }
        return prev + 10;
      });
    }, 500);
  };

  const handleToolClick = (toolIndex) => {
    startAIProcessing(() => {
      navigate('/style-editor', { 
        state: { 
          selectedProfile: selectedProfile,
          selectedCategory: selectedCategory,
          isFavorite: isFavorite,
          selectedTool: toolIndex
        }
      });
    });
  };

  const handleCameraClick = () => {
    fileInputRef.current.click();
  };

  return (
    <div className={styles.container}>
      {/* Hidden file input for image upload */}
      <input
        type="file"
        ref={fileInputRef}
        accept="image/*"
        style={{ display: 'none' }}
      />

      {/* Header */}
      <div className={styles.header}>
        <div className={styles.headerTopRow}>
          <button className={styles.closeButton} onClick={handleClose}>✕</button>
          <button className={styles.cartButton}>
            <img 
              src="/assets1/images/shopping-cart.png" 
              alt="Cart"
              className={styles.cartIcon}
            />
          </button>
        </div>
        <div className={styles.headerBottomRow}>
          <div className={styles.starContainer}>
            <img 
              src="/assets1/icons/star.png" 
              alt="Star"
              className={styles.starIcon}
            />
          </div>
          <button className={styles.heartButton} onClick={toggleFavorite}>
            <img 
              src="/assets1/icons/heart-circle.png"
              alt="Favorite"
              className={styles.heartIcon}
            />
          </button>
        </div>
      </div>

      {/* Main Image */}
      <div className={styles.mainImageContainer}>
        <img 
          src={mainImage}
          alt="Style preview"
          className={styles.mainImage}
        />
      </div>

      {/* Profiles */}
      <div className={styles.profilesContainer}>
        {profileImages.map((image, index) => (
          <button
            key={index}
            className={`${styles.profileButton} ${selectedProfile === index ? styles.selected : ''}`}
            onClick={() => handleProfileClick(index)}
          >
            <img 
              src={image}
              alt={`Profile ${index + 1}`}
              className={styles.profileImage}
            />
          </button>
        ))}
      </div>

      {/* Categories */}
      <div className={styles.categoriesContainer}>
        {categories.map((category, index) => (
          <button
            key={index}
            className={`${styles.categoryButton} ${selectedCategory === index ? styles.selected : ''}`}
            onClick={() => setSelectedCategory(index)}
          >
            {category}
          </button>
        ))}
      </div>

      {/* Bottom Toolbar */}
      <div className={styles.toolbar}>
        {toolbarItems.map((item, index) => (
          <button
            key={item.id}
            className={styles.toolButton}
            onClick={() => handleToolClick(index)}
          >
            <img src={item.icon} alt={item.label} className={styles.toolIcon} />
            <span className={styles.toolLabel}>{item.label}</span>
          </button>
        ))}
      </div>

      {/* Processing Overlay */}
      {isProcessing && (
        <div className={styles.processingOverlay}>
          <div className={styles.processingContent}>
            <div className={styles.processingCircle}>
              <div 
                className={styles.processingProgress}
                style={{ width: `${processingProgress}%` }}
              />
            </div>
            <p className={styles.processingText}>Processing your style...</p>
          </div>
        </div>
      )}
    </div>
  );
}
